import React from "react";

const NotFound = () => (
  <div className="jumbotron">
    <h1 className="display-4">404 PAGE NOT FOUND !</h1>
    <p className="lead">
      Page not exist
    </p>
    <p><a href="/">Retun To Home</a></p>
  </div>
);

export default NotFound;
